import React from 'react'
import {BrowserRouter,Route} from 'react-router-dom';
import Login from './Login';
import SignUp from './SignUp';
const App = () => {
  return (
    <div>
        <BrowserRouter>
        <Route path='/login' exact component={Login}></Route>
        </BrowserRouter>
    </div>
  )
}

export default App
